import { render } from "@testing-library/react";

const NumberButton = (props) => {    
    return (
        <button className="button">{props.number}</button>
    );
}

const Keyboard = () => {
    let keyboard;
    for(let i = 0; i<9; i++) {
        keyboard += <NumberButton number="{i}" />
    }
    //keyboard = <NumberButton number="1" />
    return keyboard;
}

export default Keyboard;
